package v2

import (
	"bytes"
	"compress/gzip"
	"encoding/base64"
	"io/ioutil"
	"testing"

	"github.com/golang/protobuf/proto"
	rspb "k8s.io/helm/pkg/proto/hapi/release"
)

func TestReleaseDecrypt(t *testing.T) {
	datas := ""

	rl, err := DecodeRelease(datas)
	if (err != nil) {
		t.Error(err)
	} 
	rl, err = ReleaseDecrypt(rl)
	if (err != nil) {
		t.Error(err)
	} 
	t.Log(rl)
	if rl.Namespace != "openstack" {
		t.Error("decode fail, ", rl)
	}
	
}

// DecodeRelease decodes release data from a tiller resource (configmap/secret)
func DecodeRelease(data string) (*rspb.Release, error) {
	// base64 decode string
	b, err := base64.StdEncoding.DecodeString(data)
	if err != nil {
		return nil, err
	}

	// For backwards compatibility with releases that were stored before
	// compression was introduced we skip decompression if the
	// gzip magic header is not found
	if bytes.Equal(b[0:3], []byte{0x1f, 0x8b, 0x08}) {
		r, err := gzip.NewReader(bytes.NewReader(b))
		if err != nil {
			return nil, err
		}
		b2, err := ioutil.ReadAll(r)
		if err != nil {
			return nil, err
		}
		b = b2
	}

	var rls rspb.Release
	// unmarshal protobuf bytes
	if err := proto.Unmarshal(b, &rls); err != nil {
		return &rls, err
	}
	return &rls, nil
}